Static variables are those variables that retain their values between different function calls. Static variables are initialized only once at compile time and they have internal linkage. Static variables can be either global or local.
Register variables are those variables that are stored in a register instead of RAM. The register keyword is used to declare a register variable. The compiler may not store the variable in a register, it is only a suggestion to the compiler. The register variables have no linkage and they are used to increase the speed of the program.
The main difference between static and register variables is that static variables retain their values between different function calls whereas register variables do not retain their values between different function calls. Another difference is that static variables have internal linkage whereas register variables have no linkage.
Here is an example of static and register variables in C:
int add(int x, int y) {
    static int count = 0; // static variable
    register int sum; // register variable
    sum = x + y;
    count++; // increment static variable
    return sum;
    int result = add(10, 20);
    printf("%d\n", result); // prints 30
    result = add(30, 40);
    printf("%d\n", result); // prints 70
    printf("%d\n", count); // error: 'count' undeclared (first use in this function)
