function sortAlphanumerically(arr, key) {
  return arr.sort((a, b) => {
    const aValue = a[key];
    const bValue = b[key];
    const aIsNumber = !isNaN(aValue);
    const bIsNumber = !isNaN(bValue);

    if (aIsNumber && bIsNumber) {
      return aValue - bValue;
    } else if (aIsNumber) {
      return -1;
    } else if (bIsNumber) {
      return 1;
    } else {
