 The entity is 7 bits long. The arraybuffer will be 1 byte long for every 8 entities.

Here is a simple example of how you can achieve this in JavaScript:
```javascript
function packEntities(entities) {
  const buffer = new ArrayBuffer(entities.length);
  const view = new Uint8Array(buffer);

  let byte = 0;
  let bitOffset = 0;

  for (let i = 0; i < entities.length; i++) {
    const entity = entities[i];
    const id = entity.id;
    const size = entity.size;

    // Pack id (4 bits)
    byte |= (id & 0xF) << bitOffset;
    bitOffset += 4;

    // Pack size (3 bits)
    byte |= (size & 0x7) << bitOffset;
    bitOffset += 3;

    // Write byte to buffer if it's full
    if (bitOffset >= 8) {
      view[i >> 3] = byte;
      byte = 0;
      bitOffset = 0;
    }
  }

  // Write last byte to buffer if it's not empty
  if (bitOffset > 0) {
    view[entities.length >> 3] = byte;
  }

  return buffer;
}

function unpackEntities(buffer) {
  const view = new Uint8Array(buffer);
  const entities = [];

  let byte = 0;
  let bitOffset = 0;

  for (let i = 0; i < view.length * 8; i++) {
    if (bitOffset === 0) {
      byte = view[i >> 3];
    }

    // Unpack id (4 bits)
    const id = (byte >> bitOffset) & 0xF;
    bitOffset += 4;

    // Unpack size (3 bits)
    const size = (byte >> bitOffset) & 0x7;
    bitOffset += 3;

    entities.push({ id, size });

    // Move to next byte if necessary
    if (bitOffset >= 8) {
      bitOffset = 0;
    }
  }

  return entities;
}
```
